import React, { useState } from 'react';

function InscriptionActivite() {
  const [nom, setNom] = useState('');
  const [prenom, setPrenom] = useState('');
  const [age, setAge] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    // Ici vous pouvez envoyer les données à votre backend
    console.log({ nom, prenom, age });
    alert('Inscription soumise !');
  };

  return (
    <div className="container my-5 btn-se-connecter" style={{ maxWidth: '600px' }}>
      <h2>Inscription à une activité</h2>
      <form onSubmit={handleSubmit}>
        {/* Nom */}
        <div className="mb-3">
          <label className="form-label">Nom</label>
          <input
            type="text"
            className="form-control"
            value={nom}
            onChange={(e) => setNom(e.target.value)}
            required
          />
        </div>

        {/* Prénom */}
        <div className="mb-3">
          <label className="form-label">Prénom</label>
          <input
            type="text"
            className="form-control"
            value={prenom}
            onChange={(e) => setPrenom(e.target.value)}
            required
          />
        </div>

        {/* Âge */}
        <div className="mb-3">
          <label className="form-label">Âge</label>
          <input
            type="number"
            className="form-control"
            value={age}
            onChange={(e) => setAge(e.target.value)}
            required
          />
        </div>

          {/* Relation membre */}
        <div className="mb-3">
          <label className="form-label">Relation membre</label>
          <input
            type="text"
            className="form-control"
            value={nom}
            onChange={(e) => setNom(e.target.value)}
            required
          />
        </div>


        <button type="submit" className="btn btn-primary btn-se-connecter">
          S'inscrire
        </button>
      </form>
    </div>
  );
}

export default InscriptionActivite;
